import React, { Component } from 'react';

class ChildRegistration extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: '',
      dateOfBirth: '',
      parentName: '',
      contactInfo: '',
      parentWallet: '',
      successMessage: '',
      error: null,
      loading: false,
    };
  }

  handleChange = (e) => {
    this.setState({ [e.target.name]: e.target.value });
  };

  registerChild = async () => {
    const { name, dateOfBirth, parentName, contactInfo, parentWallet } = this.state;

    if (!name || !dateOfBirth || !parentName || !contactInfo || !parentWallet) {
      this.setState({ error: 'Please fill in all fields.' });
      return;
    }

    try {
      this.setState({ loading: true, error: null });

      const dobTimestamp = Math.floor(new Date(dateOfBirth).getTime() / 1000);

      const receipt = await this.props.sendTransaction(
        this.props.contract.registerChild,
        [name, dobTimestamp, parentName, contactInfo, parentWallet, '']
      );

      // Extract tokenId from event logs
      let tokenId;
      const event = receipt.events?.find((e) => e.event === 'ChildRegistered');
      if (event && event.args) {
        tokenId = event.args.tokenId.toString();
      }

      this.setState({
        successMessage: `‚úÖ Child registered successfully!\nToken ID: ${tokenId}`,
        loading: false,
        name: '',
        dateOfBirth: '',
        parentName: '',
        contactInfo: '',
        parentWallet: '',
      });

      alert(`üéâ Child registered successfully!\nüìÑ Token ID: ${tokenId}\nüí° Please save this Token ID to record future vaccinations.`);

    } catch (error) {
      console.error('Child registration failed:', error);
      this.setState({ error: error.message || 'Registration failed', loading: false });
    }
  };

  render() {
    const { name, dateOfBirth, parentName, contactInfo, parentWallet, error, loading, successMessage } = this.state;

    return (
      <div className="form-container">
        <h2>üë∂ Register Child</h2>
        <div className="form-group">
          <label>Child Name</label>
          <input type="text" name="name" value={name} onChange={this.handleChange} placeholder="Enter child's name" />
        </div>
        <div className="form-group">
          <label>Date of Birth</label>
          <input type="date" name="dateOfBirth" value={dateOfBirth} onChange={this.handleChange} />
        </div>
        <div className="form-group">
          <label>Parent Name</label>
          <input type="text" name="parentName" value={parentName} onChange={this.handleChange} />
        </div>
        <div className="form-group">
          <label>Parent Contact</label>
          <input type="text" name="contactInfo" value={contactInfo} onChange={this.handleChange} />
        </div>
        <div className="form-group">
          <label>Parent Wallet Address</label>
          <input type="text" name="parentWallet" value={parentWallet} onChange={this.handleChange} />
        </div>

        {error && <div className="error-message">‚ùå {error}</div>}
        {successMessage && <div className="success-message">‚úÖ {successMessage}</div>}

        <button onClick={this.registerChild} disabled={loading} className="btn-primary">
          {loading ? 'Registering...' : 'Register Child'}
        </button>
        <button onClick={this.props.onBack} className="btn-secondary">‚Üê Back</button>
      </div>
    );
  }
}

export default ChildRegistration;
